description:
The Suicide Plan - Hidden World of Assited Suicide

Sociopolitical Documentary hosted by Will Lyman, published by PBS broadcasted as part of PBS Frontline series in 2012 - English narration


Information
------------------------------

You have an incurable illness, you want to die, and you want help dying - what can you do? People who are terminally ill and live in Oregon or Washington can openly ask a doctor for help, but in the rest of country, where physician-assisted suicide is illegal, people who are suffering turn in secret to friends, family members, and even activist organizations. In this groundbreaking 90-minute film, FRONTLINE explores the shadow world of assisted suicide, where the lines between legality and criminality are blurred as never before. With intimate access to decisions near the end of life, FRONTLINE takes viewers inside one of the most polarizing social issues of our time - told not only by the people choosing to die, but also by their &quot;assisters,&quot; individuals and right-to-die organizations at risk of prosecution for their actions to hasten death.

